// src/pages/CartPage.js
import React, { useEffect, useState } from "react";
import { Box, Typography, Grid, Paper, Button, TextField } from "@mui/material";
import { getCart, removeFromCart, updateCartItem } from "../api/cart";
import { useNavigate } from "react-router-dom";

export default function CartPage() {
  const [items, setItems] = useState([]);
  const navigate = useNavigate();

  const fetch = () => {
    getCart().then(res => setItems(res.data)).catch(console.error);
  };

  useEffect(() => { fetch(); }, []);

  const handleRemove = (id) => {
    removeFromCart(id).then(fetch).catch(console.error);
  };

  const handleQty = (id, qty) => {
    if (qty < 1) return;
    updateCartItem(id, { quantity: qty }).then(fetch).catch(console.error);
  };

  const formatSelections = (obj) => {
    if (!obj || typeof obj !== "object") return "None";
    return Object.entries(obj)
      .map(([key, value]) => `${key}: ${value}`)
      .join(", ");
  };

  const formatToppings = (arr) => {
    if (!Array.isArray(arr) || arr.length === 0) return "None";
    return arr.join(", ");
  };

  const total = items.reduce(
    (sum, it) => sum + (it.totalPrice ?? (it.basePrice * (it.quantity || 1))),
    0
  );

  if (!items.length)
    return <Typography sx={{ p: 3 }}>Your cart is empty.</Typography>;

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>My Cart</Typography>

      <Grid container spacing={2}>
        {items.map(it => (
          <Grid item xs={12} key={it.id}>
            <Paper sx={{ p: 2, display: "flex", gap: 2, alignItems: "center" }}>
              
              {/* Image */}
              <img
                src={`/images/${it.image}`}
                alt={it.name}
                style={{
                  width: 120,
                  height: 120,
                  borderRadius: 8,
                  objectFit: "cover"
                }}
              />

              <Box sx={{ flex: 1 }}>
                <Typography variant="h6">{it.name}</Typography>

                {/* Human-readable selections */}
                <Typography sx={{ mt: 1 }}>
                  <strong>Selections:</strong> {formatSelections(it.selectedSingle)}
                </Typography>

                {/* Human-readable toppings */}
                <Typography>
                  <strong>Toppings:</strong> {formatToppings(it.selectedToppings)}
                </Typography>
              </Box>

              {/* Quantity + Price + Remove */}
              <Box sx={{ display: "flex", flexDirection: "column", alignItems: "flex-end" }}>
                <TextField
                  type="number"
                  value={it.quantity}
                  onChange={(e) =>
                    handleQty(it.id, Math.max(1, parseInt(e.target.value || "1")))
                  }
                  sx={{ width: 80, mb: 1 }}
                  InputProps={{ inputProps: { min: 1 } }}
                />

                <Typography variant="subtitle1" sx={{ fontWeight: "bold" }}>
                  ₹{it.totalPrice ?? (it.basePrice * it.quantity)}
                </Typography>

                <Button color="error" sx={{ mt: 1 }} onClick={() => handleRemove(it.id)}>
                  Remove
                </Button>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      <Typography variant="h5" sx={{ mt: 3 }}>
        Total: ₹{total}
      </Typography>

      <Button
        variant="contained"
        color="primary"
        sx={{ mt: 2 }}
        onClick={() => navigate("/checkout")}
      >
        Proceed to Checkout
      </Button>
    </Box>
  );
}
